import React from 'react';
import NavBar from '../src/components/navbar';
import './App.css';
import { Switch, Route } from 'react-router-dom';
import MainDash from '../src/components/maindash';

function App() {
	return (
		<div className='App'>
			<Switch>
				<Route exact path='/dashboard' component={MainDash} />
			</Switch>
		</div>
	);
}

export default App;
